CREATE TABLE [dbo].[Product] (
    [Id]                INT            IDENTITY (1, 1) NOT NULL,
    [CategoryId]        INT            NULL,
    [Model]             VARCHAR (30)   NOT NULL,
    [GuaranteeWarranty] NVARCHAR (100) DEFAULT (N'جو گارنٹی کارڈ میں ہے وہی گارنٹی ہے') NULL,
    [PurchasePrice]     INT            NOT NULL,
    [SalePrice]         INT            NOT NULL,
    [InstallmentRatio]  FLOAT (53)     NOT NULL,
    [FirstPaymentRatio] FLOAT (53)     NOT NULL,
    [InstallmentPrice]  AS             ([SalePrice]*[InstallmentRatio]+[SalePrice]),
    [FirstPayment]      AS             (([SalePrice]*[InstallmentRatio]+[SalePrice])*[FirstPaymentRatio]),
    [NoOfMonths]        INT            NOT NULL,
    [MonthlyPayment]    AS             ((([SalePrice]*[InstallmentRatio]+[SalePrice])-([SalePrice]*[InstallmentRatio]+[SalePrice])*[FirstPaymentRatio])/[NoOfMonths]),
    [Quantity]          INT            NOT NULL,
    PRIMARY KEY CLUSTERED ([Id] ASC),
    FOREIGN KEY ([CategoryId]) REFERENCES [dbo].[Category] ([Id]) ON DELETE CASCADE ON UPDATE CASCADE
);

SET IDENTITY_INSERT [dbo].[Product] ON
SET IDENTITY_INSERT [dbo].[Product] OFF
